import { createSlice } from '@reduxjs/toolkit'

const initialState = [
  { id: '1', name: 'First Post!', url: 'Hello!', icon_url: '', subscriber_count: '' },
  { id: '2', name: 'Second Post', url: 'More text', icon_url: '', subscriber_count: '' }
]

const subscriptionsSlice = createSlice({
  name: 'subscriptions',
  initialState,
  reducers: {}
})

export default subscriptionsSlice.reducer
